function getParameterByName(name){var match=RegExp("[?&]"+name+"=([^&]*)").exec(window.location.search);return match&&decodeURIComponent(match[1].replace(/\+/g," "))}function dateToString(d){return new Date(d).toLocaleString()}function durationToReadableString(ns){var hours=Math.floor(ns/36e11%60),minutes=Math.floor(ns/6e10%60),seconds=Math.floor(ns/1e9%60),milliseconds=Math.floor(ns/1e3*1e3%60);return hours=hours<10?"0"+hours:hours,minutes=minutes<10?"0"+minutes:minutes,seconds=seconds<10?"0"+seconds:seconds,hours+":"+minutes+":"+seconds+"."+milliseconds}